&lt;p&gt;&lt;a href="http://www.flickr.com/people/msvg/"&gt;MSVG&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/msvg/4681303746/" title="Mercury Mystique"&gt;&lt;img src="http://farm5.static.flickr.com/4035/4681303746_b2e8929def_m.jpg" width="240" height="180" alt="Mercury Mystique" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Well on the morning of June 7, 2010, my mom was driving along when the light ahead of her turned to amber. She compressed her brakes and nothing. The car would not stop. She panicked slamming on the brakes, with no result, leaving a trail of brake fluid behind her as she zipped though the intersection. She then pulled on the e-brake and that's where the car stood. &lt;br /&gt;
&lt;br /&gt;
She seemed pretty distraught over it. &lt;br /&gt;
&lt;br /&gt;
Right after dropping her off at work, my father had the car towed to a mechanic and went car shopping. My father said there is no use fixing this car as it's been causing nothing but headaches this last year.&lt;br /&gt;
&lt;br /&gt;
So, we went to a local auto dealer where we've already bought 3 cars to purchase our 4th. (look below)&lt;br /&gt;
&lt;br /&gt;
Anyone in Toronto want a nice vehicle go to Swift Auto ( &lt;a href="http://www.swiftauto.ca" rel="nofollow"&gt;Swift Auto&lt;/a&gt; )&lt;br /&gt;
&lt;br /&gt;
After that, I had the burden of getting rid of the old Mystake... i mean Mystique. I removed all my mother's belongings and sat there waiting for the junk car removal person i had googled.&lt;br /&gt;
