From the City of Wheatland website:&lt;br /&gt;
&amp;quot;Established in 2005, the Wheatland Fire Authority is a Joint Powers Agency made up of the City of Wheatland and the Plumas Brophy Fire Protection District. The makeup of the Authority Board consists of 2 members of the Wheatland City Council and 2 members of the Plumas Brophy Board. Because of growth in the region and recent passage of a fire assessment in the JPA area, the Board has initiated the transition from an all volunteer fire force to a combined full time and volunteer force. Currently the Authority has one paid full-time firefighter and one part-time paid firefighter. The volunteer program is very active with 34 volunteers currently on the roles. There is also a Fire Explorer program with 10 active participants.  In 2006 the Wheatland Fire Authority responded to 673 total calls for service, 364 of which were medical aid.&amp;quot;&lt;/p&gt;

