&lt;p&gt;The Ghan is a passenger train operating between Adelaide, Alice Springs, and Darwin on the Adelaide-Darwin railway in Australia.[1] Operated by Great Southern Railway and with locomotives provided by Pacific National, the journey takes 48 hours to travel the 2,979 kilometres (1,852 miles).[2][3] The service's name is an abbreviated version of its previous nickname The Afghan Express, unofficially bestowed on the &amp;quot;express passenger&amp;quot; service of the Commonwealth Railways in 1923, by one of its crews[4]&lt;/p&gt;

